import React from 'react';
import { useImagenContext } from '../context';

function ImagenCargada() {
  const { imagenCargada } = useImagenContext();
  // Dentro de ImagenCargada

return (
  <div className='imgcargada'>Imagen Cargada
    <div className='muestraimagen'>
      {imagenCargada.url && <img src={imagenCargada.url} alt={`Imagen Cargada: ${imagenCargada.nombre}`} />}
    </div>
  </div>
);

}

export default ImagenCargada;
